import {cardData} from "../data/cat_data";
import Card from "./Components/Card";
import "./Cats.css";

function Cats({selectPage}){
    const catCards = cardData.map(item =>{
        return (
            <div className="cat_card" key={item.title}>
                <Card title={item.title} imgSrc={item.imgSrc} imgAlt={item.imgAlt} text={item.text} selectPage={selectPage} path={item.path} />
            </div>
        );
    });
    return (
        <>
            <h2 className="cat_title">Famous Pets</h2>
            <div className="cat_main__content">
                {catCards}
            </div>
        </>
    )
}
export default Cats;
